class CHZBitmapResampler : public CHZBitmapProcessor
{
public:

	static enum FILTER
	{
		BELL,
		BOX,
		CATMULLROM,
		COSINE,
		CUBICCONVOLUTION,
		CUBICSPLINE,
		HERMITE,
		LANCZOS3,
		LANCZOS8,
		MITCHELL,
		QUADRATIC,
		QUADRATICBSPLINE,
		TRIANGLE
	};

	CHZBitmapResampler(int nWidth, int nHeight, FILTER nFilter);
	virtual ~CHZBitmapResampler();

	virtual CSize CalcDestSize(CSize sizeSrc);
	virtual BOOL ProcessPixels(RGBX* pSrcPixels, CSize sizeSrc, RGBX* pDestPixels, CSize sizeDest);

protected:

private:
	int m_nWidth;
	int m_nHeight;
	FILTER m_nFilter;
	float m_fRadius;

	float Bell(float x);
	float Box(float x);
	float CatmullRom(float x);
	float Cosine(float x);
	float CubicConvolution(float x);
	float CubicSpline(float x);
	float Hermite(float x);
	float Lanczos3(float x);
	float Lanczos8(float x);
	float Mitchell(float x);
	float Quadratic(float x);
	float QuadraticBSpline(float x);
	float Triangle(float x);
		
};


